  <script>
    // Create a function to save the GIF
    function saveGifWithClipPath(elementSelector, clipPathSelector, filename, frameDelay) {
      // Get the HTML element to capture
      const element = document.querySelector(elementSelector);

      // Get the clip path element
      const clipPathElement = document.querySelector(clipPathSelector);

      // Capture the content of the element using html2canvas
      html2canvas(element, {
        onclone: function (clone) {
          // Clone the clip path element and add it to the captured clone
          const clipPathClone = clipPathElement.cloneNode(true);
          clone.getElementById(clipPathClone.id).remove();
          clone.body.appendChild(clipPathClone);
        }
      }).then(canvas => {
        // Create a new GIF.js instance
        const gif = new GIF({
          workers: 2,
          quality: 10,
          workerScript: 'https://hussainalhabeb1000.github.io/pages/gif.worker.js'
        });

        // Add the canvas frames to the GIF
        gif.addFrame(canvas, { delay: frameDelay });

        // Render the GIF
        gif.on('finished', function (blob) {
          // Create a download link for the GIF
          const url = URL.createObjectURL(blob);
          const link = document.createElement('a');
          link.href = url;
          link.download = filename;
          link.click();

          // Clean up the temporary URL
          URL.revokeObjectURL(url);
        });

        gif.render();
      });
    }

    // Usage example
    saveGifWithClipPath('#myElement', '#myClipPath', 'myGif.gif', 100);
  </script>



</body></html>
